INSERT INTO `pages` (`id`, `page`, `content`, `page_es`, `content_es`, `created_at`) VALUES
(1, 'Terms & Conditions', '<div><p><strong><span style=\"font-size: 18pt;\">Términos y condiciones</span></strong></p><p><br></p><p>Las presentes condiciones generales de uso e información legal (en adelante, Condiciones Generales) se aplican al sitio web de zaboreats.com (en adelante, Zabor) cuyo dominio es&nbsp;www.zaboreats.com&nbsp;y a la correspondiente aplicación móvil, así como a todos sus sitios relacionados o vinculados desde&nbsp;www.zaboreats.com,&nbsp;Zabor , así como a sus afiliadas y a asociados, según establecido en el Anexo I, incluidos los sitios web de Zabor en todo Puerto Rico (en adelante y de forma conjunta, el «sitio»). El sitio es propiedad de Zabor. Al utilizar el sitio, muestras tu conformidad con las presentes condiciones de uso. Si no estás de acuerdo, te rogamos te abstenga de utilizarlo.</p><p>A través de las presentes Condiciones Generales, Zabor pone a disposición de los usuarios (en adelante Usuario o Usuarios) el sitio web y la aplicación móvil Zabor (en adelante denominadas conjuntamente, la Plataforma).</p><p>En cumplimiento de lo establecido en la normativa reguladora, se exponen los siguientes datos identificativos del titular del sitio:Denominación social:Domicilio social: Urb. Alturas de Peñuelas 1 Calle 7 F-37 Peñuelas, P. R. 00624</p><p>Datos de inscripción en el Registro de Comerciante : 1210696-0018Número de Seguro Social Patronal: 66-0942588</p><p>Patente Municipal: 00024631</p><p>Objeto</p><p>ZABOR es una compañía tecnológica , cuya actividad principal es el desarrollo y gestión de una plataforma tecnológica mediante la que a través de una aplicación móvil o de una web (en adelante, la APP) permite a determinadas tiendas locales de algunas ciudades en diferentes territorios ofertar o insertar sus productos y/o servicios a través de la misma, y en su caso, si los usuarios de la APP y consumidores de las citadas tiendas locales así lo solicitan a través de la APP, de forma accesoria, intermedia en la entrega inmediata de los productos.</p><p>Así, Zabor ha desarrollado una Plataforma mediante la cual diferentes comercios, con los que Zabor puede mantener un acuerdo comercial por el uso de la plataforma, ofrecen y/o pueden insertar una serie de productos y servicios. El Cliente tiene la posibilidad de solicitar la adquisición y/o recogida de productos y servicios de estos comercios, de forma presencial, mediante el mandato que confiere a un tercero al solicitar un pedido a través de la Plataforma, en cuyos casos Zabor actúa como mero intermediario y por lo tanto, no puede asumir ni asume responsabilidad alguna sobre la calidad de los productos o la correcta prestación de los servicios ofrecidos directamente por los comercios ni por dichos terceros.Asimismo, Zabor es una Plataforma de intermediación en la contratación telemática de servicios “on demand” . La misma pretende facilitar que aquellas personas que necesiten ayuda con sus recados, ,compras presenciales y/o recogida de productos en comercios locales (en adelante, Clientes), puedan realizar sus recados mediante y delegando en dichos terceros dispuestos a llevar a cabo voluntariamente el mandato que le confieran los Clientes (en adelante, “Mandatarios”).Los Mandatarios por lo tanto, son una red de profesionales independientes que colaboran con Zabor, cuando éstos están interesados en realizar la prestación de sus servicios , se conectan a la Plataforma de Zabor y en un tiempo determinado se comprometen a realizar el servicio que le encomiende el Cliente mediante el mencionado mandato. Como consecuencia de ello, Zabor no puede asumir la responsabilidad de los plazos de entrega en tanto dependerán del buen hacer de las tiendas locales, en la preparación de los pedidos, de los propios Mandatarios, así como de la información facilitada por los propios usuarios al realizar el pedido o de su disponibilidad y respuesta a la hora de su entrega. A estos efectos, los plazos de entrega indicados a través del Sitio son meramente orientativos.A lo largo de las presentes Condiciones Generales de Uso nos referiremos a Clientes y Mandatarios como Usuarios de la Plataforma.</p><p>Términos de Uso</p><p>El acceso a la Plataforma, y la creación voluntaria de un perfil por parte del Usuario, implica el conocimiento y la aceptación expresa e inequívoca de las presentes Condiciones Generales de Uso y Contratación y la Política de Privacidad y la Política de Cookies por parte de todos los Usuarios.</p><p>Acceso y Registro para Clientes</p><p>Para poder ser Cliente de la Plataforma es indispensable que se cumplan los siguientes requisitos:Haber cumplido o ser mayor de 18 años de edad.</p><p>Cumplimentar de manera veraz los campos obligatorios del formulario de registro, en el que se solicitan datos de carácter personal como nombre de usuario, correo electrónico, número de teléfono y número de tarjeta bancaria.</p><p>Aceptar las presentes Condiciones de Uso y Contratación.Aceptar la Política de Privacidad y Protección de Datos.Aceptar la Política de Cookies.</p><p>El Usuario garantiza que todos los datos sobre su identidad y legitimidad facilitados a Zabor en sus formularios de registro de la Plataforma son veraces, exactos y completos. Asimismo, se compromete a mantener actualizados sus datos.En el supuesto en que el Usuario facilite cualquier dato falso, inexacto o incompleto o si Zabor considera que existen motivos fundados para dudar sobre la veracidad, exactitud e integridad de los mismos, Zabor podrá denegarle el acceso y uso presente o futuro de la Plataforma o de cualquiera de sus contenidos y/o servicios.Al darse de alta en la Plataforma, el Usuario seleccionará un nombre de usuario (username) y una clave de acceso (password). Tanto el username como el password son estrictamente confidenciales, personales intransferibles. Zabor recomienda no utilizar las mismas credenciales de acceso que en otras plataformas para aumentar la seguridad de las cuentas. En el supuesto que el Usuario utilice las mismas credenciales de acceso que en otras plataformas, Zabor no podrá garantizar la seguridad de la cuenta ni asegurar que el Usuario es el único que accede a su perfil.</p><p>El Usuario se compromete a no divulgar los datos relativos a su cuenta ni hacerlos accesibles a terceros. El Usuario será el único responsable en caso de uso de dichos datos o de los servicios del Sitio por terceros, incluidas las manifestaciones y/o contenidos vertidos en la Plataforma, o cualquier otra actuación que se lleve a cabo mediante el uso del username y/o password.</p><p>El usuario será el único propietario sobre el contenido vertido por el mismo en la Plataforma. Asimismo, a través del registro en la Plataforma y la aceptación de las presentes Condiciones, el Usuario concede a Zabor, en relación con el contenido que pueda proveer, una licencia mundial, irrevocable, transferible, gratuita, con derecho a sublicencia, uso, copia, modificación, creación de obras derivadas, distribución, comunicación pública así como su explotación en cualquier forma que Zabor considere apropiada, con o sin comunicación ulterior al Usuario y sin la necesidad de liquidar cantidad alguna por los mencionados usos.</p><p>Zabor no puede garantizar la identidad de los Usuarios registrados, por lo tanto, no será responsable del uso de la identidad de un Usuario registrado por terceros no registrados. Los Usuarios se obligan a poner inmediatamente en conocimiento de Zabor la sustracción, divulgación o pérdida de sus credenciales, comunicándolo a través de los canales de comunicación ofrecidos por Zabor.</p><p>3.1 Perfil</p><p>Para poder completar el registro en la Plataforma el Usuario deberá proporcionar algunos datos como: nombre de Usuario, dirección de correo electrónico, teléfono, datos de la tarjeta bancaria, etc. Una vez completado el registro, todo Usuario podrá acceder a su perfil y completarlo, y editarlo y/o darse de baja según estime conveniente. Zabor no almacena los datos de pago de los usuarios, que serán tratados y almacenados por el prestador de servicios de pago según descrito en las presentes Condiciones y en la Política de Privacidad.</p><p>3.2. Robo o sustracción de la tarjeta de crédito</p><p>En tanto Zabor no puede garantizar la identidad de los Usuarios registrados, los Usuarios tendrán la obligación de informar a Zabor en aquellos supuestos en que tengan constancia que la tarjeta de crédito asociada a su perfil de Zabor hubiera sido robada, y/o se estuviera utilizando por un tercero de forma fraudulenta. Por ello, toda vez que Zabor y su plataforma de pago velan proactivamente por la protección de los Usuarios con las correspondientes medidas de seguridad, para el caso en que el Usuario no informara a Zabor de dicha sustracción, Zabor no será responsable del uso fraudulento que puedan hacer terceros de la cuenta del Usuario. Zabor invita a los Usuarios, en caso de robo, sustracción o sospecha de un mal uso de su tarjeta de crédito a realizar la correspondiente denuncia ante la autoridad policial.</p><p>Zabor adquiere el compromiso de colaborar con el Usuario y las autoridades competentes, si así fuera necesario, para facilitar la prueba fehaciente del cargo indebido. En caso de fraude, Zabor se reserva el derecho a interponer las acciones que en su caso fueran menester cuando resulte perjudicado por el uso indebido del sitio.</p><p>Funcionamiento del servicio. Condiciones del Mandato.</p><p>Cuando un Usuario registrado como Cliente necesite ayuda con un recado, deberá dirigirse a la plataforma web o a la correspondiente aplicación de Zabor y solicitar el servicio mediante dichos medios telemáticos. El servicio de recadería básico consiste en la recogida de un producto y su posterior entrega, ambas direcciones establecidas por el Cliente siempre que se encuentren exclusivamente dentro del territorio de actuación de Zabor. Asimismo, el Cliente puede solicitar al Mandatario que compre presencialmente productos en su nombre, los recoja y los entregue en las direcciones consignadas, a través de mandato el Mandatario se compromete a adquirir los productos encomendados por el Cliente en su nombre, y según las indicaciones y especificaciones brindadas por este último.</p><p>El Cliente es el único responsable en la correcta consignación de las direcciones de entrega y recogida en la Plataforma, por lo que exime a Zabor y al Mandatario de cualquier negligencia o error en la recogida o entrega del pedido derivada de la consignación errónea de las direcciones de entrega y recogida. Como consecuencia de ello, será el Cliente quién deba asumir el coste derivado de la incorrecta consignación de las direcciones de entrega y recogida en la Plataforma.</p><p>El Cliente deberá proporcionar toda la información, lo más detallada posible, respecto al servicio objeto del recado, y en su caso, en relación con el producto que solicite comprar al Mandatario en su nombre en las tiendas físicas. Para ello, podrá introducir los comentarios que considere útiles en el apartado “comentarios”, así como en su caso, podrá compartir con el Mandatario una fotografía para identificar el pedido. El Cliente tendrá comunicación constante con el Mandatario, pudiéndose dirigir en todo momento al Mandatario a los efectos de que éste ejecute el mandato conferido según las propias indicaciones de Cliente.</p><p>A efectos de facilitar la comunicación directa con el mandatario y en el supuesto que exista alguna incidencia en la tramitación del encargo y/o para comunicar algún cambio en el mismo, ZABOR pone a disposición de los usuarios un chat interno que permitirá el contacto directo e inmediato entre usuario y mandatario durante la ejecución del pedido. El chat dejará de estar activo en el momento en que el usuario haya recibido el producto o se haya cancelado por cualesquiera de las causas previstas. En el supuesto que el usuario quiera comunicarse con el mandatario o con Zabor tras la finalización del encargo, deberá utilizar el formulario de contacto presente en la Plataforma y contactar con el servicio de atención al cliente.</p><p>El Cliente exime a Zabor y al Mandatario de cualquier negligencia o error en las indicaciones que consigne para la compra del producto que solicite comprar en su nombre a las tiendas físicas. Como consecuencia de ello, será el Cliente quién deba asumir el coste derivado de la incorrecta consignación de las indicaciones de los productos en la Plataforma (i.e. dirección incorrecta, producto incorrecto).</p><p>En la medida que en la plataforma no conste el precio del producto/y o servicio y dado que los precios consignados en la Plataforma son orientativos, el Cliente podrá fijar un precio aproximado. En este caso, el servicio o producto podrá ser adquirido presencialmente por el Mandatario de acuerdo con lo que el Cliente haya estimado y nunca por una cantidad superior al _____% de dicha estimación. En el caso que el precio sea más alto, el Mandatario se comunicará con el Cliente para informarle de esta situación y será este último quién tome la decisión final de proceder o no con la compra presencial en tienda. Zabor, con la única finalidad de ayudar al Usuario, podrá facilitar una estimación aproximada del precio, sin que ningún caso dicha estimación pudiera resultar vinculante con el precio final que deba abonar el Usuario.</p><p>Si el producto y/o servicio no se encuentra disponible, el Mandatario deberá llamar al Cliente para exponerle las opciones. En caso de que el Cliente no se encuentre de acuerdo con ninguna de las opciones expuestas por el Mandatario y, consecuentemente, no esté interesado en las opciones alternativas, deberá asumir la política de cancelación expuesta en las presentes Condiciones Generales de Uso (en el apartado nueve). Si el Cliente no responde a las llamadas, el Mandatario esperará 5 minutos antes de marcharse.</p><p>En los supuestos en los que el Cliente no se encontrase en el lugar consignado para la entrega, el Mandatario conservará el producto durante 24 horas, o 5 minutos en el caso de productos perecederos. Asimismo, el Cliente deberá asumir el 100% del coste del servicio de recadería básico, así como del precio del producto en el caso de que se haya adquirido o contratado alguno a través del Mandatario por encargo del Cliente, y deberá volver a pagar otro servicio para recibir los productos no entregados. El Mandatario en ningún caso será responsable del deterioro o de la caducidad del producto objeto del recado.</p><p>Una vez finalizado el encargo, en el caso de que se haya solicitado la adquisición presencial de un producto, el Mandatario entregará al Cliente el recibo físico correspondiente a dicho producto, y/ o a través de correo electrónico. Si el recado tiene por objeto la mera entrega de un producto, el Mandatario se lo entregará al Cliente en el lugar y momento exacto en que éste último le indique. Todo ello sin perjuicio del recibo electrónico por el servicio que recibirá el Cliente en la dirección de correo asociado a su cuenta.</p><p>En ese momento, el Usuario, destinatario del servicio identificado por el usuario en el pedido, o cualquier tercero autorizado por el mismo, deberá ratificar el mandato conferido mediante su firma en el dispositivo del Mandatario. Zabor no puede comprobar la veracidad de la firma realizada por el Usuario. En el supuesto que el Usuario reciba confirmación de la realización del recado sin haber procedido a la ratificación del mandato por sí mismo o mediante un receptor autorizado por este, deberá comunicarlo a Zabor de forma inmediata para que la Plataforma pueda tomar las medidas oportunas a tal efecto. Zabor se reserva el derecho a comprobar las comunicaciones realizadas por el Usuario en este sentido a efectos de su corroboración y control.</p><p>ALIMENTACIÓN/PRODUCTOS ENVASADOS: Zabor recomienda al Usuario que cuando encargue productos alimenticios por mandato solicite al Mandatario y/o al restaurante o establecimiento ofertante, a través de los medios facilitados por la Plataforma, la información relativa al contenido y composición de los productos alimenticos encargados.</p><p>Devolución de productos</p><p>En caso de que el Cliente desee proceder a la devolución de un producto o desee realizar una reclamación acerca de la realización de un servicio, sin perjuicio de que Zabor, como intermediario, asuma la gestión de la misma, el responsable final siempre será el comercio en el cual se realizó la compra. En caso de reembolso del importe de la compra al Cliente, será el comercio el que tendrá potestad para decidir el método de devolución (metálico, tarjeta de crédito, vale de compra…) con independencia de que sea Glovo el que por cuenta del comercio local proceda a la devolución. Por lo tanto, la devolución de un producto adquirido por el Mandatario en ejecución del mandato conferido por el Cliente quedará sujeta en todo caso a la política de devoluciones del comercio.</p><p>Determinados establecimientos podrían no disponer de espacios abiertos al público, con lo que el Usuario no podría acceder a los mismos a efectos de tramitar la devolución o reclamación. En estos supuestos, el Usuario deberá contactar con el servicio de atención al cliente de Zabor, a través de los canales presentes en la Plataforma, con la finalidad de obtener la ayuda y soporte necesarios.</p><p>En el caso que el Usuario quiera tramitar la devolución de algún producto por no adecuarse a lo que ha solicitado a través de la plataforma, el Usuario deberá aportar una fotografía del pedido total junto con un listado de los productos incorrectos o que no se hayan entregado, así como otras evidencias que demuestren la no adecuación del producto solicitado.</p><p>El Cliente deberá comprobar los productos que el Mandatario le entregue en la dirección de entrega antes de proceder a firmar y ratificar el mandato. Con la firma, el Cliente confirma y ratifica el mandato, la compra presencial o servicio realizado en su nombre. Asimismo, el Cliente manifiesta que un tercero podrá ratificar el mandato en su nombre, por ejemplo en aquellos supuestos en que el Cliente no se encuentre en la dirección final de entrega o haya designado a un tercero para la recogida y firma. Así, recae sobre el Cliente y/o dicho tercero la responsabilidad de verificar la adecuación del servicio, así como en su caso, recabar las evidencias suficientes para justificar lo contrario.</p><p>En todo caso, será potestad del comercio determinar en cada caso la procedencia de la devolución por lo que, en caso de disputa, el Cliente deberá ponerlo en conocimiento de Zabor a través de los medios facilitados por Zabor a tal efecto.</p><p>Tarifas de los servicios y facturación</p><p>El alta y uso de la Plataforma para los Clientes es completamente gratuita.</p><p>El uso de la Plataforma por parte de los Mandatarios y los comercios puede tener un coste asociado en función del lugar destino desde el que deseen hacer uso de la Plataforma para proveer servicios.</p><p>El Cliente únicamente deberá pagar por cada servicio solicitado a través de la Plataforma en concepto del uso de la misma para la solicitud de productos y comunicación a través de la Plataforma, y por los servicios de mensajería o recadería prestados por terceros. Adicionalmente, en aquellos servicios que incluyan la compra de un producto, el Usuario deberá pagar el precio de dicho producto. El Usuario, al registrarse a través de la Plataforma y proporcionar la información bancaria requerida, autoriza expresamente a Zabor a pasar los recibos correspondientes al pago de los servicios solicitados, incluyendo el precio y la entrega de los productos solicitados.</p><p>El precio total de cada servicio puede componerse de un porcentaje variable en función de los kilómetros y tiempo que deba recorrer y utilizar el Mandatario, así como en su caso, del precio fijado por cada comercio para los casos en que el Usuario solicite la compra física de un producto o servicio. Zabor se reserva el derecho de modificar el precio en función de la franja horaria y/o distancia en la que se realice el servicio. De acuerdo con estas condiciones, el Cliente tendrá derecho a saber la tarifa aproximada de su servicio antes de la contratación del mismo y formalización del pago, exceptuando cuando el usuario no especifique la dirección de recogida. La tarifa del servicio de envío podrá variar cuando se dieran circunstancias de fuerza mayor que estuvieran fuera del alance de Zabor y que conlleven un aumento de dicha tarifa.</p><p>La tarifa podrá incluir propinas para el Mandatario y/o la tienda local cuyo importe dependerá única y exclusivamente de la voluntad del Usuario.</p><p>Zabor se reserva el derecho de modificar sus precios en cualquier momento. Los cambios efectuados tendrán efecto inmediato tras su publicación. El Usuario autoriza expresamente a Zabor para que le remita por medios telemáticos, a la dirección de correo electrónica facilitada por el mismo durante el proceso de registro, el recibo de los servicios contratados y/o las facturas generadas. En caso de requerir una factura, el usuario deberá añadir los datos fiscales a la plataforma antes de hacer el pedido.</p><p>La cancelación posterior del servicio por el usuario, cuando ya haya habido confirmación de preparación del pedido por parte del comercio local y la misma haya sido comunicada al Usuario, facultará a Zabor a cargar al Cliente la tarifa que en su caso corresponda. Asimismo, en el caso que el Usuario hubiera solicitado al Mandatario la compra de un producto en nombre suyo, si el Cliente cancelara el pedido cuando la adquisición ya estuviera realizada, asumirá los costes de los servicios de envío realizados por el Mandatario, así como del producto. Todo ello sin perjuicio de que el Cliente pueda solicitar un nuevo servicio a los efectos de devolver los productos adquiridos, o que se le entreguen en otra dirección. Para el caso de productos no perecederos, el Usuario podrá ejercitar su derecho de desistimiento ante el comercio que le ha vendido los productos. Si desea ejercer el derecho a través de Zabor, deberá contratar el nuevo servicio.</p><p>6.1. Plataformas de pago</p><p>El pago de los productos y/o servicios que se ofertan a través de la Plataforma, que se venden presencialmente en los Restaurantes y/o tiendas, y que se entregan a los Clientes de forma diferida, se efectúa transitoriamente a Zabor y éste lo transmite a los Restaurantes y/o tiendas con los que mantiene un acuerdo comercial. Los Restaurantes y/o establecimientos asociados autorizan a Zabor a aceptar el pago en su nombre, por lo que el pago del precio de cualquier producto (i.e. comida, bebida, regalo…) efectuado correctamente a favor de Zabor descargará al Cliente de las obligaciones de abonar dicho precio al Restaurante y/o establecimientos asociados.</p><p>Asimismo, el pago del Cliente le descarga de cualquier obligación respecto al Mandatario, teniendo el cobro total al Cliente efecto liberatorio sobre cualquier obligación que pudiera tener con Partners y/o Mandatarios.</p><p>El pago de los productos y/o servicios realizado por los Clientes se recibe en las cuentas de Zabor mediante una Entidad de Dinero Electrónico. Las Entidades de Dinero Electrónico están autorizadas para proporcionar servicios de pago regulados en todos los lugares en los que opera Zabor y cumplen con la normativa vigente en materia de servicios de pago para Plataformas como Zabor.</p><p>Zabor, a través del proveedor de pagos que a tal efecto tiene contratado y con el único objeto de comprobar el medio de pago facilitado, se reserva el derecho, como medida antifraude, a solicitar la preautorización de cargo de los productos encargados a través de la plataforma. La citada preautorización no supondrá, en ningún caso, el pago total del encargo en tanto éste se realizará única y exclusivamente tras la puesta a disposición de los productos al usuario o bien, por las causas descritas en los presentes términos y condiciones.Zabor, para dar un mayor soporte a los Usuarios, actuará como primer punto de contacto con los mismos y asumirá la responsabilidad por los pagos realizados a través de la plataforma. Esta responsabilidad incluye: reembolsos, devoluciones, cancelaciones y disputas de resolución, en un estadio inicial, sin perjuicio de las actuaciones que Zabor pueda realizar ante los comercios locales como únicos vendedores físicos de los productos ordenados por los Usuarios.Siguiendo cuanto descrito, en el supuesto que exista alguna disputa, Zabor ofrecerá la primera línea de soporte y reembolsará al usuario si se considera apropiado.</p><p>Si el Usuario tiene algún problema con el desarrollo de su pedido, podrá contactar al servicio de atención al usuario de Zabor a través de los medios puestos a disposición del mismo en la Plataforma.</p><p>Precio de los productos y/o servicios consignados en la PlataformaTodos los precios que se indican en la Plataforma incluyen los impuestos que pudieran ser aplicables en función del territorio desde el que opere el Usuario y en todo caso se expresarán en la moneda vigente en función del territorio desde el que opere el Usuario.</p><p>De acuerdo con la Cláusula 6 anterior, los precios aplicables en cada servicio serán los publicados en la Plataforma sujetos a las particularidades expuestas y aplicados de forma automática en el proceso de contratación en la última fase del mismo.No obstante, los precios de los productos de venta en restaurantes y/o tiendas mostrados en la Plataforma de Zabor podrán ser orientativos. En todo caso, dichos precios corresponden a los productos de venta en restaurantes y/o tiendas y son exclusivamente fijados por ellos. El Cliente podrá comunicarse con el Mandatario a los efectos de confirmar el precio final de los productos solicitados.</p><p>El Usuario asume que en todo caso la valoración económica de algunos de los productos podrá variar en tiempo real en función del establecimiento que los vende y el “stock” disponible. Para cualquier información sobre el pedido solicitado, el Usuario podrá contactar con Zabor.De acuerdo con lo anterior, el Cliente mediante la solicitud de compra y envío a través de la plataforma confiere al Mandatario un mandato para adquirir presencialmente los productos en su nombre por el precio fijado por los comercios. El Cliente podrá estar en contacto directo con el Mandatario tanto durante la realización del pedido, como en la entrega del mismo para indicar al Mandatario qué producto solicita.</p><p>códigos promocionales y/o otras ofertas o descuentos&nbsp;Zabor podrá facilitar, en cualquier momento y de forma unilateral, créditos para utilizar dentro de la Plataforma o envíos gratis a ciertos usuarios. El Usuario reconoce y acepta que los créditos y envíos gratis deberán ser utilizados dentro de los seis (6) meses a contar desde la fecha en la que se pone el crédito o envío gratis a disposición del Usuario en la Plataforma.</p><p>Los códigos promocionales y/o otras ofertas o descuentos ofertados a través de la Plataforma deberán ser correctamente consignados en la aplicación con anterioridad a la realización del pedido, en caso contrario su uso no será efectivo para el Usuario y no podrá disfrutar de los mismos.&nbsp;Siempre que una cancelación sea instada por Zabor en los términos descritos en el apartado 9 siguiente, el Cliente mantendrá la vigencia del código promocional y/o otras ofertas o descuentos para su uso futuro. Cuando la cancelación sea instada por el Usuario se estará a lo previsto en el apartado 9 siguiente.</p><p>Zabor se reserva el derecho a cancelar los códigos promocionales y/o otras ofertas o descuentos ofertados de forma unilateral, cuando tenga conocimiento de un uso fraudulento de los mismos (i.e. canjear un código promocional cuando no se es el destinatario legítimo del mismo, transmisión masiva de códigos, vender descuentos o códigos, ....), cuando haya expirado el plazo anteriormente mencionado y, asimismo, se reserva el derecho a aplicar sanciones a los usuarios por el importe del uso defraudado a la Compañía.&nbsp;Zabor no asume ninguna responsabilidad si, por fuerza mayor o sucesos que escapen de su voluntad o cuya necesidad sea justificada, se viera obligado a anular, acortar, prorrogar o modificar las condiciones de las promociones.&nbsp;En particular, Zabor no asume ninguna responsabilidad en caso de que la página web no estuviese disponible en algún momento durante las promociones o de un mal funcionamiento del sistema automatizado de las promociones.</p><p>Derecho de desistimiento y cancelación de pedidos</p><p>De acuerdo con la propia naturaleza del servicio que ofrece Zabor, el Usuario es consciente de que una vez un Mandatario haya aceptado voluntariamente un pedido, se considera que la ejecución del mandato de compra ha comenzado y por tanto el Usuario podría no tener derecho a desistir en la solicitud del servicio de forma gratuita.</p><p>Sin perjuicio de lo anterior, los costes de cancelación podrían depender de los siguientes factores;</p><p>Si el restaurante o establecimiento ha aceptado y ha empezado a preparar el pedido, se cobrará el importe de los productos. La aceptación por parte del restaurante se comunicará al usuario a través de la Plataforma y/o a través del envío de correo electrónico a la dirección registrada por el usuario.</p><p>Si el usuario cancela el pedido una vez el Mandatario ha aceptado su tramitación, se cobrará el importe de la tasa de cancelación al usuario. Se comunicará al usuario la aceptación por parte del Mandatario a través de la Plataforma.</p><p>En el supuesto que el restaurante o establecimiento y el Mandatario hayan aceptado la tramitación del pedido, se le cobrará al usuario el precio de los productos y la tasa de cancelación.</p><p>El Usuario podrá consultar los costes de cancelación totales por cada orden a través del botón “Cancelar” presente en la Plataforma. De forma previa, se mostrará al Usuario el cargo que se aplicará según los factores anteriormente descritos.</p><p>Para determinadas ciudades, los costes de cancelación podrían no ser visibles directamente desde la Plataforma. Para esos casos, los costes de cancelación que aplicarán serán los previstos en el Anexo II de las presentes Condiciones.</p><p>Si además, en el momento de cancelación del servicio, el Mandatario ya hubiese realizado la compra encomendada del producto o la contratación de un servicio, el usuario podrá encargar al Mandatario que realice la devolución del mismo. A tal efecto, el Usuario deberá satisfacer el coste total de adquisición de los productos y los costes de entrega, así como el coste del servicio de devolución. En el supuesto que el Mandatario haya podido realizar la devolución del producto, se le reintegrará al Usuario el valor del producto, debiendo éste, como se ha dicho, pagar el coste de los dos servicios de recogida y entrega, así como de devolución. La devolución en todo caso estará sujeta a las políticas de devolución del comercio, por lo que el Cliente manifiesta ser conocedor que en el caso de productos perecederos (i.e. comida), es posible que no se pueda proceder a la devolución y por lo tanto, Zabor quedará facultado para cargar tanto el producto que el Mandatario ya hubiera adquirido bajo su mandato, como el servicio de envío incurrido.</p><p>En el caso que el Cliente haya indicado de forma incorrecta la dirección de entrega de los productos, podrá consignar una nueva dirección en cualquier momento siempre que se encuentre dentro de la misma ciudad del encargo inicial y siempre y cuando esta sea una ciudad dónde Zabor ofrece su servicio de intermediación. En ese caso, el Cliente estará encargando la contratación de un nuevo servicio y acepta que se le carguen los importes correspondientes a la nueva entrega. En caso de encontrarse en otra ciudad de la inicialmente indicada, ésta no podrá modificarse para entregarse en una nueva ciudad y el encargo se cancelará, debiendo el Cliente asumir los costes generados según se establece en esta cláusula.</p><p>Zabor se reserva el derecho a cancelar un pedido sin necesidad de alegar causa justa. En caso de cancelación instada por Zabor, el Usuario tendrá derecho al reembolso de la cantidad abonada.</p><p>Zabor dispone de hojas de reclamación oficiales a disposición del consumidor, por el objeto del servicio ofrecido por Zabor, en los idiomas oficiales de los países dónde Zabor opera. Las mencionadas hojas de reclamación podrán solicitarse por parte del consumidor a través del servicio de atención al cliente de Zabor y será remitida de forma automática la opción para acceder a las mismas. El consumidor deberá especificar en el correo electrónico y la ubicación exacta desde la que realiza la solicitud que deberá coincidir con el lugar de realización del servicio, en caso de duda, será este último el lugar dónde deberá instarse la reclamación.</p><p>Condiciones especiales del servicio de encargo de compra de productos a través de Zabor</p><p>El Cliente tiene la opción de solicitar a través de la Plataforma la adquisición presencial por parte del Mandatario de una serie de productos y/o servicios que son ofrecidos por establecimientos con los que Zabor puede mantener o no un acuerdo comercial. El Cliente puede seleccionar mediante un menú desplegable dentro de la Plataforma, una serie de opciones donde se puede indicar de forma orientativa las características, el precio, así como en ocasiones, hasta una fotografía del producto o servicio.</p><p>En aquellos supuestos en los que el Usuario desee conocer la composición e información nutricional de los productos presentes en la Plataforma, éste deberá contactar directamente (mediante contacto facilitado por Zabor para mayor comodidad) con cada establecimiento para que pueda acceder a la información completa de los productos.</p><p>Una vez el Cliente seleccione una de las opciones, podrá completar además el pedido mediante un espacio de texto libre para incorporar información más detallada o instrucciones para el Mandatario que se encargue de llevar a cabo dicho pedido.</p><p>A través del espacio libre, el Cliente manifiesta su voluntad de encargar la compra presencial de determinados productos, resultando el Mandatario un mero mandatario por cuenta de este. Como consecuencia de ello, sería el cliente el único responsable y quién, llegado el caso, asumiría cualquier incidencia derivada de la naturaleza de dichos productos (i.e. sanción, responsabilidad civil y/o penal, responsabilidad patrimonial…). A este respecto es importante comunicar al Usuario que Zabor colabora activamente con las autoridades de cada país con la finalidad de luchar contra el fraude, tráfico de estupefacientes, blanqueo de capitales, terrorismo y suplantación de identidad, entre otros. Por lo tanto, el Usuario es conocedor que Zabor podrá comunicar los datos de los mismos a las autoridades públicas, cuando así lo soliciten, con la finalidad de prevenir y evitar la comisión de estos u otros delitos.</p><p>El Cliente es consciente y acepta que las descripciones y, en su caso, los precios o las fotografías de los productos y/o servicios ofertados en la Plataforma se realizan en base a la información y documentación proporcionada por los Comercios por lo que Zabor no puede ofrecer garantías frente a posibles inexactitudes en dichas descripciones, precios y/o fotografías.</p><p>Asimismo, el Cliente acepta que todos los productos reflejados en la plataforma de Zabor están sujetos a la disponibilidad de los mismos y en este sentido asume la posibilidad de que durante la realización del pedido se encuentre con la no disponibilidad del producto y/o servicio en el Comercio. Adicionalmente, el precio del producto puede variar ligeramente a causa de modificaciones en el punto de venta. Zabor se reserva el derecho de proceder con la compra ante variaciones en el precio de hasta un _____ % si superar el citado _____ % el Mandatario se pondrá en contacto con el cliente para transmitirle la situación.</p><p>Zabor se reserva el derecho a retirar cualquier producto de su plataforma, así como de modificar el contenido de su ficha en cualquier momento, sin que le pueda ser atribuido ningún tipo de responsabilidad.</p><p>10.1 Entregas en el mismo día</p><p>Zabor proporciona al Cliente un servicio de entrega de los productos adquiridos presencialmente por el Mandatario en determinadas ciudades. El pedido se podrá realizar siempre que se cumplan las siguientes condiciones en el momento de pago del pedido:</p><p>El servicio se encuentre operativo para la franja horaria escogida.</p><p>La mercancía a entregar debe encontrarse dentro de alguna de las ciudades y dentro del espacio habilitado en las que opere Zabor.</p><p>El lugar de destino debe estar situado en la misma ciudad en la que se encuentre el producto.</p><p>El tamaño del pedido no puede superar las medidas: ___________________________</p><p>El peso máximo a cargar en un pedido será, aproximadamente, de ______ libras*</p><p>*El tamaño y peso mencionados anteriormente no aplicarán para los supuestos de vehículos habilitados para dichos volúmenes.</p><p>10.2 Precio y método de pago</p><p>El precio del producto y/o servicio será el indicado por el Comercio a través de la Plataforma. Sin embargo, el Cliente es conocedor que en todo caso la valoración económica de algunos de los productos podrá variar en tiempo real, debido a las disponibilidades de stock de los establecimientos que se ofertan en la plataforma, y que en todo caso el coste final será siempre comunicado al Cliente de forma previa al momento de pago.</p><p>El Cliente tendrá contacto continuo con el Mandatario, que actuará en su nombre en la adquisición de productos y servicios, por lo que cualquier cambio o variación será comunicada por el Mandatario de forma previa a la ejecución del mandato para la aprobación del Cliente. En caso de querer realizar alguna apreciación sobre el pedido encargado, el Cliente tendrá siempre la posibilidad de contactar directamente con el Mandatario que ejecuta el mandato otorgado.</p><p>De igual forma, durante la pasarela de pago, el Cliente será informado del precio final del envío y la hora aproximada de entrega según las condiciones del servicio de recadería de Zabor expresadas más arriba.</p><p>El Cliente podrá realizar el pago de los productos y/o servicios en efectivo o a través de su tarjeta de crédito. La opción de pago en efectivo podrá no estar disponible en todos los lugares donde opera Zabor. Se informará al Cliente, cuando acceda a realizar el pedido, de las diferentes opciones de pago que tenga según el territorio desde el que solicite el servicio. Para el pago con tarjeta, el Cliente deberá facilitar los datos de la mismas a través de la plataforma como método de pago asociado a su cuenta. Zabor no almacena el número de la tarjeta en sus servidores, y sólo podrá visualizar los cuatro últimos dígitos de ésta. La información completa será almacenada en los servidores del prestador de servicios de pago que realiza los pagos en nombre de Zabor . El pago con tarjeta de crédito no supondrá ningún coste extra para el Cliente. Todo ello de acuerdo con los términos de la plataforma de pago expuestos en la Cláusula 6.1.</p><p>En caso de pago en efectivo, el cliente deberá abonar el precio en el momento de la entrega del producto y/o cumplimiento del recado en el lugar de entrega. El cliente no podrá negarse a abonar el coste del servicio de entrega y/o el precio del producto solicitado. El cliente únicamente podrá negarse a abonar el coste del servicio si ha realizado una queja y ha recibido de parte de Zabor una resolución favorable del mismo al momento de la entrega.</p><p>Cuando el cobro del servicio al cliente no pudiera realizarse por cualquier motivo, la cuenta del usuario quedará bloqueada en tanto no se regularice y abone la deuda.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;10.3. Envío de muestras gratuitas a domicilio y otras acciones comerciales</p><p>Zabor se reserva el derecho a realizar acuerdos comerciales con Comercios, Grandes Superficies, Empresarios, Profesionales (i.e. empresas de gran consumo del sector alimentación, laboratorios, Grandes Almacenes, marcas de gran y pequeño consumo…) a los efectos de realizar comunicaciones promocionales, incluyendo el envío de muestras gratuitas a domicilio junto al pedido solicitado por el Usuario.</p><p>Condiciones particulares para el servicio</p><p>Zabor, a través de la Plataforma, pone a disposición de los Usuarios una categoría dónde éstos pueden seleccionar entre una gama de productos generalmente presentes, entre otros, en supermercados, grandes almacenes y/o establecimientos de cuidado personal para que el Mandatario, que acepte la tramitación del recado, pueda entregarlo en la dirección introducida por el usuario.</p><p>El Usuario deberá seleccionar los productos en base a sus preferencias y podrá solicitar, a través de los mecanismos previstos en la Plataforma, la información relativa a los alérgenos, intolerancias, composición y/o información nutricional de los mismos, que se facilitarán a través del chat de contacto o a través del correo electrónico del Usuario registrado en la Plataforma. Asimismo, Zabor podrá poner a disposición de los Usuarios que lo soliciten los enlaces informativos dónde poder encontrar y revisar dicha información. Para los pedidos de “Zabor ” aplicarán las previsiones previstas en el apartado 10.1 anterior.</p><p>Cada Orden podrá tener un espacio de texto libre para que el USUARIO pueda agregar los comentarios correspondientes respecto de su Orden, para ser recibidos por el Mandatario a efectos de clarificación.</p><p>Una vez realizada la orden, el Mandatario se dirigirá al/los lugar/es de recogida establecido/s por el Usuario a fin de recoger la/s Orden/es junto con la Confirmación de la misma en la APP. Para la recogida de la Orden, el Mandatario deberá exhibir la Confirmación de la Orden en la APP. Finalmente, el Mandatario deberá entregar la Orden a la/s dirección/es de entrega designada/s.</p><p>El Usuario podrá cancelar de forma gratuita la Orden en tanto el Mandatario no la haya aceptado. No obstante, si el Usuario cancela una Orden aceptada por un Mandatario, el Usuario deberá pagar el 100% del precio en concepto de cancelación de una orden ya en curso.</p><p>En el caso que el Mandatario haya llegado a la dirección de entrega y el destinatario de la Orden no aparezca en el plazo de 10 (diez) minutos de espera e intentos de comunicación, el Mandatario deberá devolver la Orden a la dirección inicial de recogida, estando Zabor facultado para cobrar al Usuario los gastos adicionales correspondientes por el nuevo servicio realizado.</p><p>En caso de que el Usuario tenga algún inconveniente durante la solicitud de la Orden, deberá contactar al servicio de soporte de ZABOR.</p><p>El pago por el servicio prestado podrá ser realizado de las siguientes formas, de libre elección por parte del Usuario:</p><p>Tarjeta de crédito: El Usuario podrá abonar cada Orden individualmente mediante una tarjeta de crédito en las misma forma y condiciones que las presentes en las Condiciones Generales de Uso y Contratación</p><p>Pago mensual / domiciliación bancaria: ZABOR cargará el total generado por el Usuario durante un mes natural mediante domiciliación bancaria según la información facilitada por el Usuario.</p><p>En caso de desactivación de la domiciliación bancaria y, consecuentemente, ante la imposibilidad de realizar el cobro correspondiente, se cargará el importe adeudado por el Cliente en su tarjeta de crédito asociada en el mismo día que ZABOR reciba la devolución de la domiciliación. En este supuesto, el cliente deberá asumir los costes originados por la devolución de la domiciliación (i.e. cargos bancarios).</p><p>Compra de bebidas alcohólicas</p><p>Los Usuarios que realicen un pedido que incluya la adquisición y/o entrega de bebidas alcohólicas a través de la plataforma deben ser mayores de edad, habiendo cumplido los 18 años. Al realizar un pedido que incluya bebidas alcohólicas, el Usuario confirma que tiene al menos 18 años de edad. Zabor se reserva el derecho de negarse a permitir el pedido de compra y/o entrega de alcohol a cualquier persona que no pueda probar tener al menos 18 años de edad.</p><p>La presente cláusula será de idéntica aplicación a cualquier otro producto y/o servicio análogo reservado a la mayoría de edad según legislación vigente y que sea solicitado por un Usuario a través de la Plataforma.</p><p>Asimismo, en los casos y en las ciudades en que se encuentre restringida la venta y/o entrega de bebidas alcohólicas en determinada franja horaria, el Usuario es responsable de realizar pedidos en los horarios permitidos según la normativa de aplicación. Zabor se reserva el derecho a negarse a permitir el pedido de compra y/o entrega de alcohol fuera de los horarios permitidos.</p><p>Productos en oficinas de farmacia</p><p>Zabor no realiza la venta ni publicidad de medicamentos de uso humano a través de la Plataforma cumpliendo con la normativa vigente. Los Mandatarios actúan como mandatarios de aquellos Usuarios que solicitan medicamentos de uso humano no sujetos a prescripción médica a través de la Plataforma para su recogida.</p><p>Zabor garantiza en todo caso a los Usuarios el consejo farmacéutico antes de solicitar sus medicamentos, para ello ZABOR ha habilitado una casilla en SOLICITUD ESPECIAL para que en caso de duda por parte del Usuario consulte al farmacéutico que dispensará el producto o productos a través del mismo todo ello con la finalidad que el Farmacéutico pueda dispensar el producto adecuado.</p><p>En cualquier caso, Zabor no se hace responsable del uso que hagan los Usuarios de los productos solicitados en la sección de Farmacia así como tampoco responderá por las cantidades y/o condiciones de los productos que se dispensen en las oficinas de farmacia.</p><p>Adicionalmente, la Plataforma podrá ceder a la farmacia que dispense el medicamento solicitado por el Usuario, el nombre de usuario y teléfono de éste, a efectos de responderle a las cuestiones planteadas. Dicha cesión estará sujeta en todo caso a la autorización expresa e inequívoca del Usuario de acuerdo con la legislación aplicable en materia de protección de datos de carácter personal.</p><p>14. .Geolocalización</p><p>Zabor podrá recoger, utilizar y compartir datos precisos sobre localizaciones, incluyendo la localización geográfica en tiempo real del ordenador o dispositivo móvil del Usuario, siempre que el Usuario lo autorice. Estos datos de localización pueden ser recogidos y utilizados por Zabor para mostrar a los Usuarios la ubicación del origen de un recado y/o la ubicación del origen de destino. En este sentido, los Usuarios consienten expresamente que sus datos de geolocalización sean compartidos con otros Usuarios y Proveedores para poder llevar a éxito el recado solicitado en cada momento. Los Usuarios podrán optar por desactivar la Geolocalización en sus dispositivos según se detalla en la Política de Privacidad de Datos.</p><p>Es responsabilidad del Usuario consignar correctamente las direcciones de recogida y entrega. En este sentido, Zabor no se responsabiliza de error u omisión en la consignación de las mismas por parte del Usuario.</p><p>Obligaciones del Usuario</p><p>Los Usuarios son completamente responsables del acceso y correcto uso de su perfil y demás contenidos de la Plataforma con sujeción a la legalidad vigente, sea nacional o internacional del País desde el que hace uso de la Plataforma, así como a los principios de buena fe, a la moral, buenas costumbres y orden público. Y específicamente, adquiere el compromiso de observar diligentemente las presentes Condiciones Generales de Uso.</p><p>Los Usuarios son responsables de consignar correctamente nombres de usuario y contraseñas individuales, no transferibles y lo suficientemente complejas, así como no usar el mismo nombre de usuario y contraseña que en otras plataformas, todo ello con la finalidad de proteger su cuenta del uso fraudulento por parte de terceros ajenos a la plataforma.</p><p>Los Usuarios se abstendrán de usar su perfil y el resto de contenidos de la Plataforma con fines o efectos ilícitos y que sean lesivos de los derechos e intereses de terceros, o que de cualquier forma puedan dañar, inutilizar, afectar o deteriorar la Plataforma, sus contenidos y sus servicios. Asimismo, queda prohibido impedir la normal utilización o disfrute de la Plataforma a otros Usuarios.</p><p>Zabor no podrá ser considerada responsable editorial, y declara expresamente que no se identifica con ninguna de las opiniones que puedan emitir los Usuarios de la Plataforma, de cuyas consecuencias se hace enteramente responsable el emisor de las mismas.</p><p>Quienes incumplan tales obligaciones responderán de cualquier perjuicio o daño que ocasionen. Zabor no responderá de ninguna consecuencia, daño o perjuicio que pudiera derivarse de dicho acceso o uso ilícito por parte de terceros.</p><p>En general, los Usuarios se comprometen, a título enunciativo y no taxativo, a:</p><p>No alterar o modificar, total o parcialmente la Plataforma, eludiendo, desactivando o manipulando de cualquier otra las funciones o servicios de la misma;</p><p>No infringir los derechos de propiedad industrial e intelectual o las normas reguladoras de la protección de datos de carácter personal;</p><p>No usar la Plataforma para injuriar, difamar, intimidar, violar la propia imagen o acosar a otros Usuarios; - No acceder a las cuentas de correo electrónico de otros Usuarios;</p><p>No introducir virus informáticos, archivos defectuosos, o cualquier otro programa informático que pueda provocar daños o alteraciones en los contenidos o sistemas de Zabor o terceras personas;</p><p>No remitir correos electrónicos con carácter masivo y/o repetitivo a una pluralidad de personas, ni enviar direcciones de correo electrónico de terceros sin su consentimiento;</p><p>No realizar acciones publicitarias de bienes o servicios sin el previo consentimiento de Zabor.</p><p>Cualquier Usuario podrá reportar a otro Usuario cuando considere que está incumpliendo las presentes Condiciones Generales de Uso, asimismo todos los Usuarios pueden informar a Zabor de cualquier abuso o vulneración de las presentes condiciones, a través del Formulario de Contacto. Zabor verificará este reporte, a la mayor brevedad posible, y adoptará las medidas que considere oportunas, reservándose el derecho a retirar y/o suspender a cualquier Usuario de la Plataforma por el incumplimiento de las presentes Condiciones Generales de Uso. Asimismo Zabor se reserva el derecho a retirar y/o suspender cualquier mensaje con contenido ilegal u ofensivo, sin necesidad de previo aviso o posterior notificación.</p><p>Baja del Usuario</p><p>El Usuario podrá darse de baja de la Plataforma comunicándolo mediante un correo electrónico a través del Formulario de Contacto.</p><p>Responsabilidad de Zabor</p><p>El Usuario es responsable de contar con los servicios y equipos necesarios para la navegación por Internet y para acceder a la Plataforma. En caso de cualquier incidencia o dificultad para acceder a la Plataforma, el Usuario puede informarlo a Zabor a través de los canales de contacto puestos a disposición del Usuario, que procederá a analizar la incidencia y dará indicaciones al Usuario acerca de cómo resolverla en el plazo más breve posible.</p><p>Zabor no controla ni es responsable de los contenidos vertidos por los Usuarios a través de la Plataforma, siendo estos el único responsable de la adecuación legal de dichos contenidos.</p><p>Zabor no responderá en caso de interrupciones del servicio, errores de conexión, falta de disponibilidad o deficiencias en el servicio de acceso a Internet, ni por interrupciones de la red de Internet o por cualquier otra razón ajena a su control.</p><p>Zabor no se hace responsable de los errores de seguridad que se puedan producir ni de los daños que puedan causarse al sistema informático del Usuario (hardware y software), a los ficheros o documentos almacenados en el mismo, como consecuencia de:</p><p>La presencia de un virus en el sistema informático o terminal móvil del Usuario que sea utilizado para la conexión a los servicios y contenidos de la Plataforma;</p><p>Un mal funcionamiento del navegador;</p><p>Del uso de versiones no actualizadas del mismo.</p><p>18. Responsabilidad por contenidos</p><p>Zabor no tiene obligación de controlar y no controla la utilización que los Usuarios hacen de la Plataforma y, por consiguiente, no garantiza que los Usuarios utilicen la Plataforma de conformidad con lo establecido en las presentes Condiciones Generales de Uso, ni que hagan un uso diligente y/o prudente de la misma. Zabor no tiene la obligación de verificar y no verifica la identidad de los Usuarios, no la veracidad, vigencia, exhaustividad y/o autenticidad de los datos que los mismos proporcionan.</p><p>Zabor no verificará los productos que puedan recogerse o enviarse a través de los pedidos realizados a través de la Plataforma. Por esta razón, tanto el Usuario como el Mandatario eximen a Zabor de cualquier responsabilidad que pudiera derivarse de la puesta a disposición y/o transporte de productos que requieran permisos o licencias específicos, así como productos prohibidos por cualquier normativa de aplicación. En el supuesto que Zabor tenga conocimiento que el Usuario y/o el Mandatario utilizan la APP para el transporte de productos prohibidos, podrá iniciar una investigación interna para esclarecer los hechos, interponer las medidas legales necesarias y/o bloquear al Usuario o Mandatario correspondiente hasta la finalización de la posible investigación. Entre las medidas a disposición de Zabor se encuentra el poner a disposición de las autoridades los datos e informaciones de los Usuarios y Mandatarios.</p><p>Zabor excluye cualquier responsabilidad por los daños y perjuicios de toda naturaleza que pudieran deberse a la utilización ilícita de la Plataforma por parte de los Usuarios o que puedan deberse a la falta de veracidad, vigencia, exhaustividad y/o autenticidad de la información que los Usuarios proporcionan a otros Usuarios acerca de sí mismos y, en particular, aunque no de forma exclusiva, por los daños y perjuicios de toda naturaleza que puedan deberse a la suplantación de la personalidad de un tercero efectuada por un Usuario en cualquier clase de comunicación realizada a través de la Plataforma. En particular, Zabor no se hace responsable del uso de la aplicación así como de los pedidos que pudiera realizar un tercero desde la cuenta del Usuario.</p><p>Sin perjuicio de lo anterior, Zabor se reserva la facultad de limitar, total o parcialmente, el acceso a la Plataforma a determinados Usuarios, así como de cancelar, suspender, bloquear o eliminar determinado tipo de contenidos, mediante la utilización de instrumentos tecnológicos aptos al efecto, si tuviese conocimiento efectivo de que la actividad o la información almacenada es ilícita o de que lesiona bienes o derechos de un tercero. En este sentido, Zabor podrá establecer los filtros necesarios a fin de evitar que a través del servicio puedan verterse en la red contenidos ilícitos o nocivos. La puesta a disposición por parte de los Usuarios de contenidos a través de la Plataforma supondrá la cesión a favor de Zabor de todos los derechos de explotación derivados de los contenidos suministrados en la Plataforma.</p><p>Cláusula de \"no garantía\" en los recados ni en los pagos</p><p>Zabor no ofrece ninguna garantía con respecto a la autenticidad, la exactitud, la novedad, la fiabilidad, legalidad o no violación de derechos de terceros por parte de los Mandatarios. En este sentido, los Usuarios manifiestan que comprenden que Zabor es una plataforma tecnológica, cuya principal actividad es la intermediación, esto es, pone en contacto Clientes y Mandatarios, por lo que no asume responsabilidad alguna derivada de la información proporcionada por los Mandatarios ni por los daños o pérdidas que eventualmente pudieran sufrir por un incumplimiento de las presentes Condiciones Generales de Uso. Al realizar el pedido a través de la APP y su aceptación por parte del Mandatario, se establecerá una relación directa entre el Usuario y el Mandatario, siendo Zabor ajena a la misma, facilitando únicamente la APP para que las Partes puedan comunicarse y realizar cuantos pedidos sean necesarios. Por ello Zabor no será nunca responsable ni de la disponibilidad de los Mandatarios ni del cumplimiento adecuado y satisfactorio de los recados por parte de éstos.</p><p>Zabor no realiza confirmación alguna, ni valida ningún Mandatario ni su identidad ni antecedentes. Sin perjuicio de lo anterior, Zabor puede eventualmente realizar comprobaciones adicionales y poner en marcha procedimientos destinados a ayudar a verificar o a comprobar las identidades de los Mandatarios. En este sentido, cuando un Usuario alcanza el estatus de Mandatario ello simplemente indica que dicho usuario ha completado el proceso de alta correspondiente y ha aceptado las presentes Condiciones Generales de Uso y cualquier otra condición particular que le resultara aplicable. No implica ni certificación ni aval acerca de su fiabilidad, idoneidad y/o seguridad por parte de Zabor.</p><p>Por ello Zabor les recomienda a los Clientes que empleen siempre el sentido común y toda su atención a la hora de delegar un recado a un determinado Mandatario.</p><p>Al ser miembros de la Plataforma, los Usuarios aceptan que cualquier responsabilidad legal que pretendan ejercitar como consecuencia de acciones u omisiones de otros Usuarios de la Plataforma o terceros se limitará a dichos Usuarios o terceros, no procediendo acción de responsabilidad alguna contra Zabor.</p><p>Actualización y Modificación de la Plataforma</p><p>Zabor se reserva el derecho de modificar, en cualquier momento y sin previo aviso las presentes Condiciones Generales de Uso, la Política de Privacidad y la Política de Cookies. Los Usuarios deberán leer atentamente estas Condiciones Generales al acceder a la Plataforma. En cualquier caso, la aceptación de las Condiciones Generales será un paso previo e indispensable al acceso de los servicios y contenidos disponibles a través de la Plataforma de Zabor App.</p><p>Asimismo, Zabor se reserva la facultad de efectuar, en cualquier momento y sin necesidad de previo aviso, actualizaciones, modificaciones o eliminación de información contenida en su Plataforma en la configuración y presentación de ésta y de las condiciones de acceso, sin asumir responsabilidad alguna por ello. Zabor no garantiza la inexistencia de interrupciones o errores en el acceso de la Plataforma o a su contenido, ni que ésta se encuentre siempre actualizada, no obstante, Zabor llevará a cabo, siempre que no concurran causas que lo hagan imposible o de difícil ejecución, y tan pronto tenga noticia de los errores, desconexiones o falta de actualización en los contenidos, todas aquellas labores tendentes a subsanar los errores, restablecer la comunicación y actualizar los contenidos.</p><p>Propiedad Intelectual</p><p>Zabor es titular o licenciataria de todos los derechos de propiedad intelectual e industrial incluidos en la Plataforma así como sobre los contenidos accesibles a través de la misma. Los derechos de propiedad intelectual de la Plataforma, así como: textos, imágenes, diseño gráfico, estructura de navegación, información y contenidos que se recogen en ella son titularidad de Zabor, a quien corresponde el ejercicio exclusivo de los derechos de explotación de los mismos en cualquier forma y, en especial, los derechos de reproducción, distribución, comunicación pública y transformación, de conformidad con la legislación española de derechos de propiedad intelectual e industrial.</p><p>Aún cuanto descrito anteriormente, Zabor</p><p>podría no ser titular ni licenciatario de contenidos como nombres o imágenes, entre otros, de compañías con las cuales Zabor no tiene relación comercial. En esos supuestos, Zabor adquiere los contenidos de fuentes accesibles al público y en ningún caso se entenderá que Zabor tenga relación con ningún derecho titularidad de Zabor.</p><p>La autorización al Usuario para el acceso a la Plataforma no supone renuncia, transmisión, licencia o cesión total ni parcial sobre derechos de propiedad intelectual o industrial por parte de Zabor. No está permitido suprimir, eludir o manipular de ningún modo los contenidos de la Plataforma de Zabor. Asimismo está prohibido modificar, copiar, reutilizar, explotar, reproducir, comunicar públicamente, hacer segundas o posteriores publicaciones, cargar archivos, enviar por correo, transmitir, usar, tratar o distribuir de cualquier forma la totalidad o parte de los contenidos incluidos en la Plataforma de Zabor para propósitos públicos o comerciales, si no se cuenta con la autorización expresa y por escrito de Zabor o, en su caso, del titular de los derechos a que corresponda.</p><p>El Usuario que proceda a compartir cualquier tipo de contenido a través de la Plataforma, asegura que ostenta los derechos necesarios para hacerlo, quedando exento Zabor de cualquier responsabilidad sobre el contenido y legalidad de la información ofrecida. La facilitación de contenidos por parte de los Usuarios a través de la Plataforma supondrá la cesión a Zabor , con carácter gratuito, y con la máxima amplitud permitida por la legislación vigente, de los derechos de explotación de propiedad intelectual o industrial derivados de tales contenidos.</p><p>Independencia de las Cláusulas</p><p>Si cualquiera de las cláusulas de las presentes Condiciones Generales fuera nula de pleno derecho o anulable, se tendrá por no puesta. Dicha declaración de nulidad no invalidará el resto del Contrato, que mantendrá su vigencia y eficacia entre las Partes.</p><p>Legislación Aplicable</p><p>La relación entre ZABOR y el Usuario, se regirá e interpretará de conformidad con las Condiciones Generales que en materia de interpretación, validez y ejecución se regirán por la legislación del Estado Libre Asociado de Puerto Rico; y cualquier controversia se someterá a los Tribunales de Justicia de Puerto Rico, salvo que el Usuario solicite los tribunales de su domicilio de residencia.</p><p>Resolución extrajudicial de conflictos</p><p>Los conflictos o controversias que tuvieran lugar fuera de Puerto Rico quedarán sujetos a su resolución por parte del Tribunal o de la Cámara de Comercio.</p><p><br></p></div><p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif;\"></p>', 'sdf', '<p>sdfg</p>', '2019-12-16 14:37:10');
