INSERT INTO `webdata` (`id`, `f_l_en`, `f_l_es`, `f_r_en`, `f_r_es`, `f_d_h_en`, `f_d_d_en`, `f_d_h_es`, `f_d_d_es`, `b_h_en`, `b_h_es`, `b_c_en`, `b_c_es`, `pic`, `created_date`) VALUES
(1, 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration', 'From now on we will keep you informed about promotions, discounts, offers and everything that happens in the gastronomic environment.', 'Desde ahora te mantendremos informado sobre promociones, descuentos, oferta y todo lo que ocurra en el ambiente gastronómico. ', 'Come Join US', 'This is the application that has came to change the way you enjoy your favorite dishes in your preferred restaurants.Zabor App, the delight in your hands !!!', 'Ven y únete a nosotros', 'Esta es la aplicación que llegó a cambiar la forma de disfrutar tus platos favoritos en tus restaurantes de preferencia.Zabor App, el deleite en tus manos!!!', 'Welcome to our Zabor app!', '¡ Bienvenidos a nuetra aplicación Zabor!', '<p>\n              This is the application that came to change the way you enjoy your favorite dishes in your preferred restaurants.Zabor App, the delight in your hands !!!</p>\n            <p>\n              In our application you can share your experience with your friends and acquaintances through social networks (Facebook, Instagram, Twitter). You will enjoy offers, promotions, discounts, you can make reservations, it will include orders and delivery from your favorite food places.\n            </p>\n            <p>\n              Zabor App seeks to improve the service, advertising and income of each customer-restaurant at the gastronomic level by strengthening the slogan Puerto Rico does it better.\n            </p> ', '<p _ngcontent-nye-c3=\"\" style=\"margin-bottom: 20px; font-family: arial, sans-serif; outline-style: initial !important; outline-width: 0px !important;\">Esta es la aplicación que llegó a cambiar la forma de disfrutar tus platos favoritos en tus restaurantes de preferencia.Zabor App, el deleite en tus manos!!!</p><p _ngcontent-nye-c3=\"\" style=\"margin-bottom: 20px; font-family: arial, sans-serif; outline-style: initial !important; outline-width: 0px !important;\">En nuestra aplicación podrás compartir tu experiencia con tus amigos y conocidos a través de las redes sociales ( Facebook, Instagram, Twitter). Disfrutarás de ofertas, promociones, descuentos, podrás hacer reservaciones, incluirá órdenes y delivery de tus lugares de comida favoritos.</p><p _ngcontent-nye-c3=\"\" style=\"margin-bottom: 20px; font-family: arial, sans-serif; outline-style: initial !important; outline-width: 0px !important;\">Zabor App busca mejorar el servicio, la publicidad y los ingresos de cada cliente-restaurante a nivel gastronómico fortaleciendo el slogan Puerto Rico lo hace mejor.</p>', 'webdata/pic-1589904639796.jpeg', '2020-05-19 14:40:37');
